import React from 'react';
import {MDBIcon, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  NavLink,
} from "react-router-dom";
import SignIn from './SignIn';

import {
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';
import { MDBDropdown, MDBDropdownToggle, MDBDropdownLink,MDBNavbarItem } from 'mdb-react-ui-kit';
import './myStyle.css'

import { useState } from 'react';
import { useSelector } from 'react-redux';
import SignUp from './SignUp';
import CompanyUpdate from './CompanyUpdate';
import MyCustomers from './MyCustomers';
import CalculationCustomers from './CalculationCustomers';
import Home from './Home';
import CompanyDelete from './CompanyDelete';
import ChartsPage from './Graf'
import LittleChartsPage from './LittleChart'
import logo from '../Assets/logo.jpg'
import ProfilePage from './MyUsers';

 export default function FullPageIntroWithFixedNavbar()
{
  const [state,setState]=useState({ collapse: "false",isWideEnough: "false"});
    let IsCompany = false; 
    console.log(IsCompany.codeCompany);

    return (
      <Router>
     
      
        <header>
          
         
            <MDBNavbar color="black" dark expand="md" fixed="top">
              <MDBNavbarBrand href="/">

              <img src={logo} width={'80px'} style={{float:'right'}}/> 
              </MDBNavbarBrand>
              {!state.isWideEnough && <MDBNavbarToggler onClick={onClick} />}
              <MDBCollapse isOpen={state.collapse} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                
                  </MDBNavItem>
                  
                  <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <MDBNavbarItem class="nav-item dropdown">
                  <MDBDropdown>
                    <MDBDropdownToggle  tag='a' className='nav-link'>
                      פרופיל
                  </MDBDropdownToggle>
                   
                  </MDBDropdown>
                </MDBNavbarItem>
              </ul>
              <MDBNavbarLink><NavLink  to="/Home" style={{color:"white"}}>אודות</NavLink></MDBNavbarLink>

                 
                 

                   
                    <MDBNavItem>
                    <MDBNavbarLink><NavLink to="/ChartsPage" style={{color:"white"}}>תרשים שנתי</NavLink></MDBNavbarLink>
                    </MDBNavItem>
                    <MDBNavItem>
                    <MDBNavbarLink><NavLink to="/ProfilePage" style={{color:"white"}}>תרשים שנתי</NavLink></MDBNavbarLink>
                    </MDBNavItem>

                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
            
          
             {/* <div class="img" ></div>  */}
             <div
                        className='p-5 text-center bg-image'
                        style={{ backgroundImage: "url('https://media.istockphoto.com/id/1289951048/photo/coronavirus-covid-19-vaccine.jpg?b=1&s=170667a&w=0&k=20&c=iL_eJg65Gs3fC292tHvN1l8vBUgFYZCHug74D1RrIK8=')", height: 400 }}
                    >
           </div>
                
        </header> 

        <main>
          <MDBContainer className="">
           <SignIn></SignIn>
          </MDBContainer>
        </main>
      
     
          <Switch>
       
            
            <Route path='/ChartsPage' exact component={ChartsPage}></Route>
            <Route path='/ProfilePage' exact component={ProfilePage}></Route>
          

          </Switch>     
     
      </Router>
    );
    }
